import React from "react"
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';

const PageRoutes = () =>{
    return(
        <Router>
            <Routes>
                <Route path="/login" element={<Auth/>}/>
                <Route path="/" element={<Auth/>}/>
                <Route path="/home" element={<Main/>} />
            </Routes>
        </Router>
     )
}

export default PageRoutes
